     &     USfC(Sfe7,1,3,Gen(2)) + 
     &    Sub19998(HelAll(Cha(4)),Neu(3))*USf(Sfe6,2,4,Gen(1))*
     &     USfC(Sfe7,2,3,Gen(2))

        Sub20003(HelAll(Cha(4)),Gen(1),Gen(2),Neu(3),Sfe6,Sfe7) = 
     &   Sub20001(HelAll(Cha(4)),Neu(3))*USf(Sfe6,1,4,Gen(1))*
     &     USfC(Sfe7,1,3,Gen(2)) + 
     &    Sub20002(HelAll(Cha(4)),Neu(3))*USf(Sfe6,2,4,Gen(1))*
     &     USfC(Sfe7,2,3,Gen(2))

        Sub20004(HelAll(Cha(4)),Gen(1),Gen(2),Neu(3),Sfe6,Sfe7) = 
     &   Sub19999(HelAll(Cha(4)),Gen(1),Gen(2),Neu(3),Sfe6,Sfe7)*
     &     Sub3855(Gen(1),Neu(3),Sfe6) + 
     &    F13*Mf(4,Gen(1))*Sub19490(HelAll(Gen(1)),Gen(2),Sfe6,Sfe7)*
     &     Sub3856(Gen(1),Neu(3),Sfe6)

        Sub20005(HelAll(Cha(4)),Gen(1),Gen(2),Neu(3),Sfe6,Sfe7) = 
     &   F12*Mf2(4,Gen(1))*Sub19490(HelAll(Gen(1)),Gen(2),Sfe6,Sfe7)*
     &     Sub3855(Gen(1),Neu(3),Sfe6) + 
     &    Mf(4,Gen(1))*Sub20003(HelAll(Cha(4)),Gen(1),Gen(2),Neu(3),Sfe6,
     &      Sfe7)*Sub3856(Gen(1),Neu(3),Sfe6)

        Sub20006(HelAll(Cha(4)),Gen(1),Gen(2),Neu(3),Sfe6,Sfe7) = 
     &   (Sqrt(2.D0)*(CB2*Sub19996(HelAll(Cha(4)),Neu(3))*
