     &      S2B*Mf(4,Gen(1))*Sub20000(HelAll(Cha(4)),Neu(3))*
     &       Sub3856(Gen(1),Neu(3),Sfe6)*UCha(Cha(4),2)*
     &       USf(Sfe7,1,3,Gen(2)))/(CB2*S2B)

        Sub20007(HelAll(Cha(4)),Gen(1),Gen(2),Neu(3),Sfe6,Sfe7) = 
     &   (CB2*(Sqrt(2.D0)*(Sub20004(HelAll(Cha(4)),Gen(1),Gen(2),Neu(3),Sfe6,
     &             Sfe7)*Sub435(Cha(4),Gen(2),Sfe7)) + 
     &         S2B*Sub20006(HelAll(Cha(4)),Gen(1),Gen(2),Neu(3),Sfe6,Sfe7)*
     &          Sub8020(HelAll(Gen(1)),Gen(2),Sfe6,Sfe7)) + 
     &      S2B*Sub20005(HelAll(Cha(4)),Gen(1),Gen(2),Neu(3),Sfe6,Sfe7)*
     &       UCha(Cha(4),2)*USf(Sfe7,1,3,Gen(2)))/(CB2*S2B)

        ENDLOOP(Sfe6)
